import React from 'react';
import './App.css';
import './css/style.css';
import VideoDisplay from './js/component/videoDisplay';
import Demo from './js/component/demo';


function App() {
  const videos = [
    'https://www.youtube.com/watch?v=zPwAeSLLoqU&feature=youtu.be',
    'https://www.youtube.com/watch?v=zPwAeSLLoqU&feature=youtu.be',
    'https://www.youtube.com/watch?v=zPwAeSLLoqU&feature=youtu.be',
    'https://www.youtube.com/watch?v=zPwAeSLLoqU&feature=youtu.be',
    'https://www.youtube.com/watch?v=zPwAeSLLoqU&feature=youtu.be',
    'https://www.youtube.com/watch?v=zPwAeSLLoqU&feature=youtu.be',
    'https://www.youtube.com/watch?v=zPwAeSLLoqU&feature=youtu.be',
    'https://www.youtube.com/watch?v=zPwAeSLLoqU&feature=youtu.be',
    'https://www.youtube.com/watch?v=zPwAeSLLoqU&feature=youtu.be',
    'https://www.youtube.com/watch?v=zPwAeSLLoqU&feature=youtu.be',
    'https://www.youtube.com/watch?v=zPwAeSLLoqU&feature=youtu.be',
    'https://www.youtube.com/watch?v=zPwAeSLLoqU&feature=youtu.be'
  ];

  const listItems = videos.map((video, index) =>
    <div key={index}>
      <VideoDisplay url={video}/>
      <div>
        <p className = 'titleDevice'>Samsung S7</p>
        <p className = 'descriptionDevice'>Android 9</p>
      </div>
    </div>
  );

  return (
    // <div className="grid-container">{listItems}</div>
        <div className="grid-container"><Demo/></div>

  );
}


export default App;
